import React, { useEffect, useState } from 'react'
import axios from 'axios'

const Apis = () => {
    const [input,setInput] = useState([])
    const handleSubmit =()=>{
        axios.get("http://localhost:8080/student/data").then((Response)=>{
            console.log(Response.data);
            
            setInput(Response.data);
        })
    }
    useEffect(()=>{
        handleSubmit()   
    },[])
  return (
    <>
    <table>
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Department</th>
            </tr>
        </thead>
        <tbody>
            {input.map()}
        </tbody>
    </table>
    
    </>
  )
}

export default Apis
